class Solution {
public:
    Solution(vector<int> w) {
        cw.push_back(w[0]);
        for( int i=1; i<w.size(); i++)  cw.push_back(cw.back()+w[i]);
    }
    
    int pickIndex() {// binary search 
        int rd=rand()%cw.back(), b=-1, e=cw.size()-1, mid;// rd=[0,cw.back()), [b,e)
        
        while( b+1<e){
            mid=b+(e-b)/2;
            if(rd<cw[mid])  e=mid;
            else    b=mid;
        }
        
        return e;
    }

protected:    
    vector<int> cw; //cumulative weight 
};

